import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

// @material-ui/icons

// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Button from "components/CustomButtons/Button.js";
import HeaderLinks from "components/Header/HeaderLinks.js";
import Parallax from "components/Parallax/Parallax.js";
import InfoArea from "components/InfoArea/InfoArea.js";

import styles from "assets/jss/material-kit-react/views/projectsStyle.js";

// @material-ui/icons
import Chat from "@material-ui/icons/Chat";
import VerifiedUser from "@material-ui/icons/VerifiedUser";
import Fingerprint from "@material-ui/icons/Fingerprint";

const dashboardRoutes = [];

const useStyles = makeStyles(styles);
export default function Contact(props) {
  const classes = useStyles();
  const { ...rest } = props;
  return (
    <div className={classNames(classes.main, classes.mainRaised)}>
        <div className={classes.container}>
        <div className={classes.section}>
            <GridContainer justify="center">
                <GridItem xs={12} sm={12} md={8}>
                <h2 className={classes.title}>Contact Me</h2>
                <h5 className={classes.description}>
                I am always open for new interesting projects and career possibilities. Feel free to send me an email, contact me in LinkedIn or give me a call!
                </h5>
                </GridItem>
            </GridContainer>
                <GridContainer>
                <GridItem xs={12} sm={12} md={4}>
                    <i className={classNames("fa", "fa-linkedin-square")} />
                    <h4>LinkedIn profile</h4>

                </GridItem>
                <GridItem xs={12} sm={12} md={4}>
                    <InfoArea
                    title="+61 431 910 225"
                    icon={VerifiedUser}
                    iconColor="success"
                    vertical
                    />
                </GridItem>
                <GridItem xs={12} sm={12} md={4}>
                    <InfoArea
                    title="LinkedIn profile"
                    icon="icon"
                    iconColor="danger"
                    vertical
                    />
                </GridItem>
            </GridContainer>
        </div>
      </div>
      </div>

  );
}
